import React, { useRef } from 'react'

function Nav({handleCampaignType}){
    const upcomingCampaignRef  = useRef(null) ;
    return(
        <nav className="navBar">
            <a href="#" onClick={(e)=>{e.preventDefault() ; handleCampaignType(1)}} className='links' ref={upcomingCampaignRef} >Upcoming Campaings</a>
            <a href="#" onClick={(e)=>{e.preventDefault() ; handleCampaignType(0)}} className='links'>Live Campaigns</a>
            <a href="#" onClick={(e)=>{e.preventDefault() ; handleCampaignType(-1)}} className='links'>Past Campaings</a>
        </nav>
    )
}

export default Nav ;
